def downgrade() -> None:
    """Remove St. Gallen municipality data."""
    op.execute("""
        DELETE FROM swisstax.church_tax_rates
        WHERE canton = 'SG'
          AND municipality_id IS NOT NULL
          AND tax_year = 2025
    """)
    print("✓ Removed St. Gallen municipality data (2025)")
